import React from 'react'
import { 
  
  Stack, 
  styled,
  Grid,
} from '@mui/material'

import imgMen from '../assets/men.png';




const Information = () => {

    const StackColumn = styled(Stack) (() => ({
      flexDirection: 'row',
      justifyContent: 'flex-',
      alignItems: 'center',
      flex: 1,
      gap: 8,
      textAlign: 'center',
    }));
  

  
    return (
      
   
        <StackColumn>
        <Grid item xs={6} md={4}>
        <img src={imgMen} alt="Homem Apontando" class="imagem-direita"/>
       </Grid>
   
        </StackColumn>
     
    )
  }

  export default Information
